measurements.description:
Eight flowers and no buds on two erect, up to 33-cm inflorescences;
 sepals and petals crisp white;
 sepals lanceolate, green spot apex; 
petals broadly ovate, margins undulate;
 lip closed over column, apical margin tightly undulate,
 white, throat striped magenta basally, striped yellow centrally,
  apical half overlaid magenta, white picotee;
 column and anther cap white;
 substance medium; texture diamond dust.
